 /// @dev makes a trade between src and dest token and send dest tokens to msg sender\\n    /// @param src Src token\\n    /// @param srcAmount amount of src tokens\\n    /// @param dest Destination token\\n    /// @param minConversionRate The minimal conversion rate. If actual rate is lower, trade is canceled.\\n    /// @return amount of actual dest tokens\\n    function swapTokenToToken(\\n        IERC20 src,\\n        uint srcAmount,\\n        IERC20 dest,\\n        uint minConversionRate\\n    )\\n        external\\n        returns(uint);\\n\\n    /// @dev makes a trade from Ether to token. Sends token to msg sender\\n    /// @param token Destination token\\n    /// @param minConversionRate The minimal conversion rate. If actual rate is lower, trade is canceled.\\n    /// @return amount of actual dest tokens\\n    function swapEtherToToken(IERC20 token, uint minConversionRate) external payable returns(uint);\\n\\n    /// @dev makes a trade from token to Ether, sends Ether to msg sender\\n    /// @param token Src token\\n    /// @param srcAmount amount of src tokens\\n    /// @param minConversionRate The minimal conversion rate. If actual rate is lower, trade is canceled.\\n    /// @return amount of actual dest tokens\\n    function swapTokenToEther(IERC20 token, uint srcAmount, uint minConversionRate) external returns(uint);\\n\\n    event ExecuteTrade(address indexed trader, IERC20 src, IERC20 dest, uint actualSrcAmount, uint actualDestAmount);\\n\\n    /// @notice use token address ETH_TOKEN_ADDRESS for ether\\n    /// @dev makes a trade between src and dest token and send dest token to destAddress\\n    /// @param src Src token\\n    /// @param srcAmount amount of src tokens\\n    /// @param dest Destination token\\n    /// @param destAddress Address to send tokens to\\n    /// @param maxDestAmount A limit on the amount of dest tokens\\n    /// @param minConversionRate The minimal conversion rate. If actual rate is lower, trade is canceled.\\n    /// @param walletId is the wallet ID to send part of the fees\\n    /// @param hint will give hints for the trade.\\n    /// @return amount of actual dest tokens\\n    function tradeWithHint(\\n        IERC20 src,\\n        uint srcAmount,\\n        IERC20 dest,\\n        address destAddress,\\n        uint maxDestAmount,\\n        uint minConversionRate,\\n        address walletId,\\n        bytes calldata hint\\n    )\\n        external\\n        payable\\n        returns(uint);\\n\\n    event KyberNetworkSet(address newNetworkContract, address oldNetworkContract);\\n\\n    function getExpectedRate(IERC20 src, IERC20 dest, uint srcQty)\\n        external view\\n        returns(uint expectedRate, uint slippageRate);\\n\\n    function getUserCapInWei(address user) external view returns(uint);\\n\\n    function getUserCapInTokenWei(address user, IERC20 token) external view returns(uint);\\n\\n    function maxGasPrice() external view returns(uint);\\n\\n    function enabled() external view returns(bool);\\n\\n    function info(bytes32 field) external view returns(uint);\\n\\n}","sourcePath":"/home/dsz/git/galaxistest/galaxis/contracts/DexInterfaces/KyberInterface.sol","ast":{"absolutePath":"/home/dsz/git/galaxistest/galaxis/contracts/DexInterfaces/KyberInterface.sol","exportedSymbols":{"KyberInterface":[1132]},"id":1133,"nodeType":"SourceUnit","nodes":[{"id":987,"literals":["solidity","^","0.6",".0"],"nodeType":"PragmaDirective","src":"0:23:11"},{"absolutePath":"@openzeppelin/contracts/token/ERC20/IERC20.sol","file":"@openzeppelin/contracts/token/ERC20/IERC20.sol","id":988,"nodeType":"ImportDirective","scope":1133,"sourceUnit":4189,"src":"25:56:11","symbolAliases":[],"unitAlias":""},{"abstract":false,"baseContracts":[],"contractDependencies":[],"contractKind":"interface","documentation":{"id":989,"nodeType":"StructuredDocumentation","src":"83:350:11","text":"/////////////////////////////////////////////////////////////////////////////////////////////////////\\n @title Kyber Netwo